import {
    BarChart, Bar, XAxis, YAxis, Tooltip, CartesianGrid, ResponsiveContainer, Legend,
  } from 'recharts';

  const VaccineBreakdownChart = ({ data }) => (
    <div className="card mt-5 p-4">
      <h4 className="mb-4 text-center">Vaccination Breakdown by Type</h4>
      {data.length > 0 ? (
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={data}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="vaccine" />
            <YAxis allowDecimals={false} />
            <Tooltip />
            <Legend />
            <Bar dataKey="count" fill="#4caf50" />
          </BarChart>
        </ResponsiveContainer>
      ) : (
        <p className="text-muted text-center">No vaccination data available</p>
      )}
    </div>
  );

  export default VaccineBreakdownChart;
